import { StyleSheet, Dimensions } from "react-native";
import { Colors } from './colors'
const { width, height } = Dimensions.get("window");

const commonStyles = {
    window: {
        width,
        height
    },
    container: {
        flex: 1,
    },
    justifyContent: {
        flexDirection: "row",
        justifyContent: "space-between",
        alignItems: "center"
    },
    justifyCenter: {
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center"
    },
    center: {
        justifyContent: "center",
        alignItems: "center"
    },
    fontDefault: {
        fontSize: 16,
        color: Colors.black
    }
}

export const Styles = StyleSheet.create({
    ...commonStyles
});
